import './App.css';
import React, { useEffect, useState } from 'react';
import NameForm from './component/NameForm';
import DisplayPanel from './component/DisplayPanel';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  const [data, setData] = useState([])

  const assignData=(values)=>{
    const temp = Object.values(values)
    console.log(typeof(values));
    console.log(values);
    console.log(typeof(temp));
    console.log(temp);
    setData(values);
    console.log(data);
  }

  const fetchdata= async (object) =>{

    console.log('values from FORM', object);
    await fetch(`http://172.16.0.107:9000/api/assets/temp?categoryId=${object.category}&bundleId=${object.bundle}`)
        .then((response) => response.json())
        .then((actualData) => {
          assignData(actualData);
        })
        .catch((err) => {
         console.log(err.message);
        });
  }

  useEffect(()=>{
    // fetchdata();
  },[])

  return (
    <div className="App">
      <NameForm/>
      <hr/>
      <DisplayPanel data={data} fetchdata={fetchdata}/>
    </div>
  );
}

export default App;
